    s = "t25 t6 t16 t23 t12 t23 t41 t6 t6"

    def is_valid(grammar, string):
        """
        Checks if a string is valid according to the given grammar.
        """
        stack = []
        for char in string:
            if char in grammar.keys():
                stack.append(char)
            elif char in grammar.values():
                if not stack:
                    return False
                top = stack.pop()
                if grammar[top] != char:
                    return False
        return not stack

    if is_valid(s, s):
        print("Yes")
    else:
        print("No")

